import React from 'react';
import './SignUp.css'

function SignUp() {
    return (
        <div className='SignUp'>
            <form action='' className='signup-form'>
                <h2>Sign Up</h2>
                <div className='signup-'></div>
            </form>
      </div>
  )
}

export default SignUp;
